"2021-06-01T15:03:10.000Z\",\"public_metrics\":{\"retweet_count\":3023,\"reply_count\":533,\"like_count\":17027,\"quote_count\":811}},{\"lang\":\"en\",\"author_id\":\"27013292\",\"conversation_id\":\"1399698343476011012\",\"source\":\"HubSpot\",\"text\":\"\\\"Vaccine nationalism threatens to turn the triumph of science to give the world vaccines against #COVID19 into tragedy.\\\"\\n\\nPrabhat Jha et al. (@countthedead) outline a 3-pillar global vaccine compact to expand vaccine supply and counter #vaccinenationalism. https://t.co/6VFalq97Jv\",\"entities\":{\"urls\":[{\"start\":257,\"end\":280,\"url\":\"https://t.co/6VFalq97Jv\",\"expanded_url\":\"https://hubs.li/H0PkLRN0\",\"display_url\":\"hubs.li/H0PkLRN0\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1405601143523352585/JGBumui5?format=png&name=orig\",\"width\":300,\"height\":300},{\"url\":\"https://pbs.twimg.com/news_img/1405601143523352585/JGBumui5?format=png&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"A global compact to counter vaccine nationalism\",\"description\":\"Vaccine nationalism threatens to turn the triumph of science to give the world vaccines against COVID-19 into tragedy. The success of several initiatives, many funded by taxpayers, to rapidly develop and test several safe and effective vaccines has been nothing short of spectacular. The social promise of SARS-CoV-2 vaccines was to reduce the underlying inequalities by race, ethnicity, and geography that COVID-19 has both made visible and amplified.1 Yet, most of the billion vaccine doses administered have been in high-income countries (HICs), with most low-income and middle-income countries (LMICs) left behind (appendix).\",\"unwound_url\":\"https://www.thelancet.com/journals/lancet/article/PIIS0140-6736(21)01105-3/fulltext?utm_campaign=lancetcovid21&utm_content=168598193&utm_medium=social&utm_source=twitter&hss_channel=tw-27013292\"}],\"mentions\":[{\"start\":142,\"end\":155,\"username\":\"countthedead\",\"i